import React from 'react'
import Row from 'react-bootstrap/Row';
import Four from '../6.jpg';
import Three from '../4.jpg';
import Two from '../3.jpg';
import One from '../10.jpg';
import Jump from 'react-reveal/Jump';
import Zoom from 'react-reveal/Zoom';
import Bounce from 'react-reveal/Bounce';

export default function Gallery() {
    return (
        <React.Fragment>
             <Row className="mt-5 justify-content-center align-items-center">
                <Zoom left cascade>
                    <Bounce left cascade>
                        <h2>KIRAN GALLERY</h2>
                    </Bounce>
                </Zoom>
            </Row>
            <Row xs={2} md={4} lg={4} className="justify-content-center align-items-center gallery">
                <Jump>
                    <img src={One} className="p img1" alt="gallery_img"/>
                </Jump>
                <Jump>
                    <img  src={Two} className="p img2" alt="gallery_img"/>
                </Jump>
                <Jump>
                    <img  src={Three} className="p img3" alt="gallery_img"/>
                </Jump>
                <Jump >
                    <img   src={Four} className="p img4" alt="gallery_img"/>  
                </Jump>                 
            </Row>
        </React.Fragment>
    )
}
